import React, { Profiler } from 'react';

import Directory from '../../components/directory/directory.component';

import { HomePageContainer } from './homepage.styles';

const HomePage = () => (
  <HomePageContainer>
    <Profiler>
      <Directory />
    </Profiler>
  </HomePageContainer>
);

export default HomePage;
